With Milan Design Week being cancelled this year due to covid19, The Mindcraft Project 2020 exhibition will be hosted digitally. The exhibition highlights artistic, research-driven and experimental works by some of the most notable contemporary designers and artists from Denmark. Norm has contributed with the Arc Collection – designed to make up sculptural elements for the home, with  distinctive yet soft silhouettes. 
Exhibition design and visuals by Wang & Söderström. Video by @michaelgramtorp #mindcraftproject #normarchitects #softminimalism
